// importing various folders/libraries to use here
import React, {Component} from "react";
import "./bAndA.css";
import Before1 from "../../assets/before1.png";
import After1 from "../../assets/after1.png";
import Before from "./before/before";
import After from "./after/after";

class BAndA extends Component {
  render() {
  return (
    <section className="gridArea">
      <div classname="cardGrid" id="gridCard1">
            <a
              target="_blank"
              href="https://tyrkgithub.github.io/group-challenge/"
            >
              <div class="head4">
                <div class="cardTitle">Creating a Navigation Bar</div>
                <div class="subTitle">My first live web application</div>
              </div>
            </a>
          </div>

          <div id="gridCard2" class="cardGrid">
            <div class="head4">
              <div class="cardTitle">Project 2</div>
              <div class="subTitle">Subtitle placeholder</div>
            </div>
          </div>
    </section>
  );
}
}

export default BAndA;
